name: STM32F7 Series
variants:
  - name: STM32F722ICKx
    cores:
      - name: main
        type: armv7em
        core_access_options:
          Arm:
            ap: 0x0
            psel: 0x0
    memory_map:
      - Ram:
          range:
            start: 0x20000000
            end: 0x20040000
          is_boot_memory: false
          cores:
            - main
      - Nvm:
          range:
            start: 0x8000000
            end: 0x8040000
          is_boot_memory: true
